import React from 'react';
import './App.css';
import { Layout, Header, Navigation, Content } from 'react-mdl';
import { Link } from 'react-router-dom';
import { Grid, Cell } from 'react-mdl'
import Resume  from './components/resume'
import Landing from './components/landingpage'
import Projects from './components/projects';

import AboutMe from './components/aboutme';
import Contact from './components/contact';

function App() {
  return (
    <div className="demo-big-content">
      <Layout>
        <Header className="header-color" title={<a style={{ textDecoration: 'none', color: 'white' }} href="#landing">Neeraj Singhi</a>} scroll>
          <Navigation>
          <a href="/resume">Resume</a>
            <a href="#projects">Projects</a>
            <a href="#aboutme">About Me</a>
            <a href="#contact">Contact</a>
          </Navigation>
        </Header>

        <Content>
          <div className="page-content" style={{padding:'0em' ,width:'100%' ,margin:'0em'}}>
          <Grid className="demo-grid-1" id="landing" style={{padding:'0em' ,width:'100%' ,margin:'0em'}}>
            <Cell col={12}  style={{padding:'0em' ,width:'100%' ,margin:'0em'}}><Landing /></Cell>
          </Grid>
          <Grid className="demo-grid-2" id="projects"  style={{padding:'0em' ,width:'100%' ,margin:'0em'}}>
            <Cell col={12}  style={{padding:'0em' ,width:'100%' ,margin:'0em'}}><Projects /></Cell>
          </Grid>
          <Grid className="demo-grid-3" id="aboutme" style={{padding:'0em' ,width:'100%' ,margin:'0em'}}>
            <Cell col={12}  style={{padding:'0em' ,width:'100%' ,margin:'0em'}}><AboutMe /></Cell>
          </Grid>
          <Grid className="demo-grid-4" id="contact"  style={{padding:'0em' ,width:'100%' ,margin:'0em'}}>
            <Cell col={12}  style={{padding:'0em' ,width:'100%' ,margin:'0em'}}><Contact /></Cell>
          </Grid>
          </div>
        </Content>
      </Layout>
    </div>
  );
}

export default App;
